import { useState } from 'react';
import Car from './Components/Car';

const App = () => {
  let carList = [
    {
      car: 'Audi'
    },
    {
      car: 'BMW'
    },
    {
      car: 'Porsche'
    }
  ]
  const PushCar = (value) => {
    if (value != undefined) {
      carList.push({ car: value.target.value })
    }
  }
  return (
    <div className="App">
      <input onChange={v => PushCar(v)} type="text" />
      <button onClick={() => PushCar}>Добавить</button>
      {carList.map(e => <Car key={e.car} name={e.car} />)}
    </div>
  );
}

export default App;
